import React, { Component } from 'react'
import './css/Dashboard.css';

export class Dashboard extends Component {
    render() {
        return (
            <div className='main-content'>
                <h1>Dashboard</h1>
                <p>this is dashboard</p>
            </div>
        )
    }
}

export default Dashboard
